script: |
  super -f text -I q89.spq | sort > q89.out

inputs:
  - name: q89.spq
    data: |
      SELECT DISTINCT + col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( NULL ) BETWEEN NULL AND - col0 + col1 * col0 OR NOT ( NULL ) NOT IN ( cor0.col2 * col2 * col1 );
  - name: tab0

outputs:
  - name: q89.out
    data: |
